// src/index.jsx

import React from 'react';
import ReactDOM from 'react-dom/client'; // Import the new createRoot API
import { Provider } from 'react-redux';
import App from './App.js';
import './index.css';
import store from './app/store.js'; // Import the store
import '@fortawesome/fontawesome-free/css/all.min.css';

// Create the root element using React 18's createRoot API
const root = ReactDOM.createRoot(document.getElementById('root'));

// Render the App component wrapped with the Provider for Redux store
root.render(
  <Provider store={store}>
    <App />
  </Provider>
);
